def build_collection_include(corpora: List[str], sample_factor=1):
    collection = []
    for corpus in corpora:
        if corpus in DATA_SOURCES.keys():
            paths = DATA_SOURCES[corpus]
            if corpus in EXTRA_DATA_SOURCES.keys():
                raise ValueError(f"Corpus {corpus} should be defined in either DATA_SOURCES or EXTRA_DATA_SOURCES, not both.")
        elif corpus in EXTRA_DATA_SOURCES.keys():
            paths = EXTRA_DATA_SOURCES[corpus]
        else:
            raise ValueError(f"Unknown corpus: {corpus}")

        assert sample_factor >= 0 and sample_factor <= 1
        if sample_factor < 1:
            random.seed(62540)
            random.shuffle(paths)
            sample_idx = math.ceil(len(paths) * sample_factor)
            paths = paths[:sample_idx]

        collection.extend(paths)
    return collection


def build_collection_exclude(corpora: List[str]):
    collection = []
    for corpus in DATA_SOURCES.keys():
        if corpus not in corpora:
            collection.extend(DATA_SOURCES[corpus])
    return collection

def build_collection_include_all(path_dict):
    collection = [path for paths in path_dict.values() for path in paths]
    return collection

def build_collection_with_weights(corpora: List[str], weights: Dict[str, float]=None):
    # the weights are used to sample the corpora. If none are provided, all corpora are sampled uniformly
    if weights is None:
        weights = {corpus: 1.0/len(corpora) for corpus in corpora}

    total_tokens = sum([SOURCES_SIZES[corpus]["total_size"] for corpus in corpora])
    current_weights = {corpus: SOURCES_SIZES[corpus]["total_size"] / total_tokens for corpus in corpora}

    #print current_weights with 2 decimal places
    print({k: round(v, 2) for k, v in current_weights.items()})

